import React from 'react';

const Profile = ({ props }) => {
    return (
        <div className="container mx-auto mt-5 text-center"> 
            <p>{ props.firstName }</p>
            <p>{ props.lastName }</p>
            <p>{ props.email }</p>
            <p>{ props.favSeason }</p>
        </div>
    );
}

export default Profile;
